import React from "react";
function ShowInfo() {



const dbRef = ref(getDatabase());
get(child(dbRef, data1)).then((snapshot) => {
  if (snapshot.exists()) {
    console.log(snapshot.val());
  } else {
    console.log("No data available");
  }
}).catch((error) => {
  console.error(error);
});


}
export default ShowInfo;
